Count 1 - PTC Burglary - No contest plea.   Convicted.   State moves to dismiss and read in count 2, criminal damage to property.   Motion granted.    Sentence is withheld.   Defendant is placed on probation to DOC for three (3) years.   Conditions of probation are:  
1) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process; 
2) Spend sixty (60) days in jail, under the Huber Law, to commence on 12-29-19 by 5:00 p.m.   Transfer to Florence County Jail is authorized.   
3) AODA assessment and follow through; 
4) Submit to random urine screens and pay for same; 
5) Maintain absolute sobriety; 
6) Have no contact with Tim Rohr; 
7) Maintain full-time employment/job search combination; 
8) Pay costs of action; 
9) Pay supervision fees in an amount to be determined by DOC;
10) Submit DNA sample and pay surcharge.   
